export class TableHogwartsComponent
  implements OnInit, AfterViewInit, OnChanges
{
  @ViewChild(MatSort) sort!: MatSort;
  @ViewChild(MatPaginator) paginator!: MatPaginator;

  @Input() columns: HogwartsTableHeader[] = [
    {
      columnDef: 'name',
      header: 'Nombre',
      textField: 'name',
    },
    {
      columnDef: 'patronus',
      header: 'Patronus',
      textField: 'patronus',
    },
    {
      columnDef: 'age',
      header: 'Edad',
      textField: 'age',
    },
    {
      columnDef: 'image',
      header: 'Foto',
      textField: 'image',
    },
  ];
  @Input() displayedColumns: string[] = ['name', 'patronus', 'age', 'image'];
  @Input() data: BaseData[] = [];

  dataSource = new MatTableDataSource(this.data);
  defaultText = '-';
  filterValue = '';

  constructor() {}

  ngOnInit(): void {}

  ngAfterViewInit(): void {
    this.initSortAndPaginator();
    this.applyFilter();
  }

  ngOnChanges(change: SimpleChanges): void {
    this.dataSource = new MatTableDataSource(change.data.currentValue);
    this.initSortAndPaginator();
    this.applyFilter();
  }

  initSortAndPaginator(): void {
    this.dataSource.sort = this.sort;
    this.dataSource.paginator = this.paginator;
  }

  applyFilter(): void {
    this.dataSource.filter = this.filterValue.trim().toLowerCase();
  }
}

